import React, {Component} from 'react';

class MonsterEyes extends Component{

    constructor(props){
        super(props)
        this.state = { left:0, top:0, random:Math.random()}
    }

    render(){
        return (
            <div className="monster"  style={{left:this.props.width*this.state.random, top:this.props.height*this.state.random}} >
                <div className="monster_sprite"></div>
                <h3>{this.props.height*this.state.random} {this.props.width*this.state.random} {this.state.top} {this.state.left} {this.state.random}</h3>
            </div>
        )
    }

}

export default MonsterEyes
